import React from "react";
import marketLogo from "../../images/services-items/img7.svg";

import "./MarketMainHeader.css";

const MarketMainHeader = () => {
    return (
        <header id="market-main-header">
            <span>
                <img src={yandexIcon} alt="" />
                <img src={marketIcon} alt="" />
                <h2>Маркет</h2>
            </span>
        </header>
    );
}

export default MarketMainHeader;
